/**
 *  Create a SortedVIntList from all elements of an array of integers.
 *
 * @param  sortedInts  A sorted array of non negative integers.
 */
public SortedVIntList(int[] sortedInts) {
  this(sortedInts, sortedInts.length);
}

/**
 *  Create a SortedVIntList from all elements of an array of integers.
 *
 * @param  sortedInts  A sorted array of non negative integers.
 */
public SortedVIntList(int... sortedInts) {
  this(sortedInts, sortedInts.length);
}

